/* --------------------------------------------
Mixin
-------------------------------------------- */
// Media query
@mixin xsmall-only {
	//Only for xsmall devices
	@media screen and (max-width: $xs) {
		@content;
	}
}
@mixin small-only {
	//Only for small devices
	@media screen and (max-width: $sm) {
		@content;
	}
}
@mixin medium-only {
	//Only for small screens, small tablet
	@media screen and (min-width: $md) and (max-width: $lg) {
		@content;
	}
}
@mixin medium {
	//For small tablet, small screens and up
	@media screen and (min-width: $md) {
		@content;
	}
}
@mixin large {
	//For most of desktops, large tablet and up
	@media screen and (min-width: $lg) {
		@content;
	}
}
@mixin xlarge {
	//For xlarge screens and up
	@media screen and (min-width: $xl) {
		@content;
	}
}
@mixin xxlarge {
	//For xxlarge screens and up
	@media screen and (min-width: $xxl) {
		@content;
	}
}

